import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import FilterDropdown from "./FilterDropdown";
import axios from "axios";
import styles from "./RegulationFilter.module.css";
import Sidebar from "../CommonComponents/Sidebar";
import TopBar from "./TopBar";

// Static fallback data
const staticCategories = {
  subdivision: ["General Requirements", "Survey Requirements", "Survey Plan Standards", "Plot Size Regulations"],
  development: ["Street", "Road and Water Body Compliance"],
  infrastructure: ["Road Access Rules"],
  community: ["Community Space Requirement"],
  residential: ["Subdivision Exemption"],
  building: ["Development Permit Validity"],
  planning: ["Site Plan Requirements"],
  safety: ["Fire Safety Compliance"],
};

// Helper function to convert object to array
const convertObjectToArray = (data) => {
  if (Array.isArray(data)) {
    return data; // Already an array
  }
  if (typeof data === "object" && data !== null) {
    return Object.values(data); // Convert object values to array
  }
  return []; // Default to empty array
};

function RegulationFilterPage() {
  const navigate = useNavigate();
  const [categories, setCategories] = useState({});
  const [subCategories, setSubCategories] = useState({});
  const [filters, setFilters] = useState({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Fetch categories on component mount
  useEffect(() => {
    setLoading(true);
    axios
      .get("http://127.0.0.1:5000/api/categories")
      .then((response) => {
        console.log("Categories API Response:", response.data); // Log the API response
        setCategories(response.data);
      })
      .catch(() => {
        console.warn("API failed. Using fallback static data.");
        console.log("Static Categories:", staticCategories); // Log static data
        setCategories(staticCategories);
      })
      .finally(() => setLoading(false));
  }, []);

  // Fetch sub-categories when a category is selected
  const handleCategoryChange = (category) => {
    if (category) {
      setLoading(true);
      axios
        .get(`http://localhost:5000/api/subcategories?category=${category}`)
        .then((response) => {
          console.log("Subcategories API Response:", response.data); // Log the API response
          setSubCategories((prev) => ({
            ...prev,
            [category]: response.data,
          }));
        })
        .catch((error) => {
          console.error(`Error fetching sub-categories for ${category}:`, error);
          setError("Failed to fetch sub-categories. Please try again later.");
        })
        .finally(() => setLoading(false));
    }
  };

  // Handle filter selection
  const handleFilterChange = (category, value) => {
    setFilters((prevFilters) => ({
      ...prevFilters,
      [category]: value,
    }));
  };

  // Generate Report based on filters
  const handleGenerateReport = () => {
    if (Object.keys(filters).length === 0) {
      setError("Please select at least one filter before generating the report.");
      return;
    }

    setLoading(true);
    axios
      .get("http://localhost:5000/api/regulation-filter", { params: filters })
      .then((response) => {
        navigate("/regulation-report", { state: { data: response.data } });
      })
      .catch((error) => {
        console.error("Error fetching filtered regulations:", error);
        setError("Failed to generate the report. Please try again later.");
      })
      .finally(() => setLoading(false));
  };

  return (
    <div className={styles.container}>
      <div>
        <Sidebar />
        <TopBar />
      </div>

      <main className={styles.mainContent}>
        <div className={styles.contentArea}>
          <h1 className={styles.title}>FILTER REGULATIONS BY...</h1>

          {loading && <p>Loading...</p>}
          {error && <p className={styles.error}>{error}</p>}

          {Object.keys(categories).map((category) => (
            <div key={category}>
              <h3>{category}</h3>
              <FilterDropdown
                placeholderText={`Eg: Select ${category}`}
                items={convertObjectToArray(subCategories[category] || categories[category])} // Ensure items is an array
                onChange={(value) => {
                  handleFilterChange(category, value);
                  handleCategoryChange(category);
                }}
              />
              <br />
            </div>
          ))}

          <button
            className={styles.generateReportButton}
            onClick={handleGenerateReport}
            disabled={loading || Object.keys(filters).length === 0}
          >
            {loading ? "Generating..." : "GENERATE REPORT"}
          </button>
        </div>
      </main>
    </div>
  );
}

export default RegulationFilterPage;
